        <td id="LC163" class="blob-code blob-code-inner js-file-line">(2, 77, &#39;Arch of Galerius&#39;, &#39;1&#39;, 8, &#39;&#39;, &#39;0000-00-00 00:00:00&#39;, &#39;&#39;, &#39;Arch of Galerius, stands on what is now Egnatia &amp; Dimitrios Gounari Street. The arch was built in 298 to 299 AD and dedicated in 303 AD to celebrate the victory of the tetrarch Galerius over the Sassanid Persians and capture of their capital Ctesiphon in 298.[2] The structure was an octopylon (eight-pillared gateway) forming a triple arch that was built of a rubble masonry core faced first with brick and then with marble panels with sculptural relief. The central arched opening was 9.7 m wide and 12.5 m high, and the secondary openings on other side were 4.8 m wide and 6.5 m high. The central arch spanned the portion of the Via Egnatia (primary Roman road from Dyrrhacium to Byzantium) that passed through the city as a Decumanus (east-west major street). A road connecting the Rotunda (125m northeast) with the Palace complex (235m southwest) passed through the arch along its long axis.\r\n\r\nOnly the northwestern three of the eight pillars and parts of the masonry cores of the arches above survive: i.e., the entire eastern side (4 pillars) and the southernmost one of the western pillars are lost.[3] Extensive consolidation with modern brick has been performed on the exposed masonry cores to protect the monument. The two pillars flanking the central arched passageway retain their sculpted marble slabs, which depict the wars of Galerius against the Persians in broadly panegyric terms.&#39;, &#39;Dim. Gounari 43, Thessaloníki 546 35, Greece&#39;, 40.632242403153730, 22.951746574760477, &#39;{&quot;id&quot;:2,&quot;imagedir&quot;:&quot;images/citybranding&quot;,&quot;files&quot;:[{&quot;name&quot;:&quot;8436660509_3dd8508526_b.jpg&quot;,&quot;size&quot;:476976,&quot;url&quot;:&quot;/cb/images/citybranding/2/8436660509_3dd8508526_b.jpg&quot;,&quot;mediumUrl&quot;:&quot;/cb/images/citybranding/2/medium/8436660509_3dd8508526_b.jpg&quot;,&quot;thumbnailUrl&quot;:&quot;/cb/images/citybranding/2/thumbnail/8436660509_3dd8508526_b.jpg&quot;,&quot;deleteUrl&quot;:&quot;/cb/administrator/index.php?option=com_citybranding&amp;task=upload.handler&amp;format=json&amp;id=2&amp;imagedir=images/citybranding&amp;92e707c3d63ca36310ea95650b04d8a3=1&amp;file=8436660509_3dd8508526_b.jpg&quot;,&quot;deleteType&quot;:&quot;DELETE&quot;},{&quot;name&quot;:&quot;Apsida_Galeriou_Thessaloniki.jpg&quot;,&quot;size&quot;:369743,&quot;url&quot;:&quot;/cb/images/citybranding/2/Apsida_Galeriou_Thessaloniki.jpg&quot;,&quot;mediumUrl&quot;:&quot;/cb/images/citybranding/2/medium/Apsida_Galeriou_Thessaloniki.jpg&quot;,&quot;thumbnailUrl&quot;:&quot;/cb/images/citybranding/2/thumbnail/Apsida_Galeriou_Thessaloniki.jpg&quot;,&quot;deleteUrl&quot;:&quot;/cb/administrator/index.php?option=com_citybranding&amp;task=upload.handler&amp;format=json&amp;id=2&amp;imagedir=images/citybranding&amp;92e707c3d63ca36310ea95650b04d8a3=1&amp;file=Apsida_Galeriou_Thessaloniki.jpg&quot;,&quot;deleteType&quot;:&quot;DELETE&quot;},{&quot;name&quot;:&quot;Arch of Galerius1.jpg&quot;,&quot;size&quot;:192686,&quot;url&quot;:&quot;/cb/images/citybranding/2/Arch%20of%20Galerius1.jpg&quot;,&quot;mediumUrl&quot;:&quot;/cb/images/citybranding/2/medium/Arch%20of%20Galerius1.jpg&quot;,&quot;thumbnailUrl&quot;:&quot;/cb/images/citybranding/2/thumbnail/Arch%20of%20Galerius1.jpg&quot;,&quot;deleteUrl&quot;:&quot;/cb/administrator/index.php?option=com_citybranding&amp;task=upload.handler&amp;format=json&amp;id=2&amp;imagedir=images/citybranding&amp;92e707c3d63ca36310ea95650b04d8a3=1&amp;file=Arch%20of%20Galerius1.jpg&quot;,&quot;deleteType&quot;:&quot;DELETE&quot;},{&quot;name&quot;:&quot;Arch-of-Galerius-1.jpg&quot;,&quot;size&quot;:466871,&quot;url&quot;:&quot;/cb/images/citybranding/2/Arch-of-Galerius-1.jpg&quot;,&quot;mediumUrl&quot;:&quot;/cb/images/citybranding/2/medium/Arch-of-Galerius-1.jpg&quot;,&quot;thumbnailU